import React, { useState } from "react";
import Select from "react-select";
import "./Explore.css";
import { FaRegStar } from "react-icons/fa";
import { CiClock1 } from "react-icons/ci";
import { FaCalendarAlt } from "react-icons/fa";
import { Link } from "react-router-dom";
import { BiSolidCameraMovie } from "react-icons/bi";
import { FaHome } from "react-icons/fa";
function Explore() {
  const [selectedOption, setSelectedOption] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");
  const [genreFilter, setGenreFilter] = useState("all");

  const opt = [
    { value: "all", label: "All Genres" },
    { value: "Action", label: "Action" },
    { value: "Comedy", label: "Comedy" },
    { value: "Drama", label: "Drama" },
    { value: "Sci-Fi", label: "Sci-Fi" },
    { value: "Thriller", label: "Thriller" },
    { value: "Crime", label: "Crime" },
    { value: "Biography", label: "Biography" },
    { value: "Adventure", label: "Adventure" },
    { value: "War", label: "War" },
    { value: "Animation", label: "Animation" }
  ];

  const handleChange = (selected) => {
    setSelectedOption(selected);
    setGenreFilter(selected.value);
  };

  const selectmovie = Movie.filter(function (movie) {
    return (
      movie.name.toLowerCase().includes(searchTerm.toLowerCase()) &&
      (genreFilter === "all" || movie.type === genreFilter)
    );
  });

  return (
    <div className="explore">
      <Link to="/">
    <div style={{
      position:"relative",
      left:"-750px",
      top:"60px",
      display:"flex",
      alignItems:"center",
      gap:"10px",
      color:"white",
      background: "rgb(69,69,69)",
      padding:"10px",
      borderRadius:"10px",
      cursor:"pointer"
    }} className="back">Return to home <FaHome />
    </div>
    </Link>
      <h1>Explore Movies</h1>
      
     
      <div className="line">
        <input
          placeholder="Search for a movie ..."
          type="search"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <Select
          options={opt}
          value={selectedOption}
          onChange={handleChange}
          placeholder="Select a genre..."
        />
      </div>

      <div style={{
        display:"grid",
        gridTemplateColumns:"repeat(3,450px)",
        gap:"40px",
        marginTop:"50px"
      }} className="all2">
        {selectmovie.map((movie) => (
          <div
            key={movie.id}
            style={{ border: "2px gray solid", borderRadius: "20px" }}
            className="new_box"
          >
            <img style={{
              width:"100%"
            }} src={movie.image} alt={movie.name} />
            <div className="inbox">
              <div style={{ height: "50px" }} className="name">
                {movie.name}
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "row",
                  alignItems: "center",
                  gap: "4px"
                }}
                className="rate"
              >
                <div style={{ color: "gold", fontSize: "20px" }}>
                  <FaRegStar />
                </div>{" "}
                {movie.rate} / 10
              </div>
              <div className="type">{movie.type}</div>
              <div style={{ height: "70px" }} className="story">
                {movie.story}
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "row",
                  justifyContent: "space-between"
                }}
                className="linee"
              >
                <div className="time">
                  <CiClock1 /> {movie.time}
                </div>
                <div className="year">
                  <FaCalendarAlt /> {movie.yearOfShow}
                </div>
              </div>
            </div>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                
              }}
              className="bb"
            >
              <Link to="/Trailer">             
              <button className="butto" style={{width:"400px", backgroundColor:"black",color:"white",borderRadius:"20px", border:"none",outline:"none",margin:"20px 0",padding:"10px",fontSize:"15px" ,display: "flex",
                justifyContent: "center",
                alignItems: "center",gap:"10px",cursor:"pointer"}} >
              Watch trailer             <BiSolidCameraMovie />
              </button>
              </Link>
       
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

